import React from 'react';
import {FarmAnimalCard} from './FarmAnimalCard';

export class Body extends React.Component{
 render(){

    const infToComponents = {
        pigComponent: { 
            imgSrc: 'https://portal-amb-imgs.clubedaana.com.br/2020/06/novo-v%C3%ADrus-gripe-porco.jpg',
            cardTitle: 'Porquinho',
            textInf: 'O porquinho cor de rosa tem muitos irmãos!',
            hrefButton: 'https://www.noticiasdecoimbra.pt/wp-content/uploads/2019/05/porco.jpg?x75216'
        },
        sheepComponent: {
            imgSrc: 'data:image/jpeg;base64,',
            cardTitle: 'Ovelhinha',
            textInf: 'Sou o animal mais quentinho da quinta, tenho tanta lã que tambem dá para ti!',
            hrefButton: ''
        },
        goatComponent: {
            imgSrc: 'data:image/jpeg;base64,',
            cardTitle: 'Cabrinha',
            textInf: 'Sou uma trepadora fantastica, os meus primos selvagens vivem no alto das montanhas!',
            hrefButton: ''
        },
        horseComponent: {
            imgSrc: 'https://ncultura.pt/wp-content/uploads/2020/01/Coudelaria-de-Santa-Margarida.jpg',
            cardTitle: 'Cavalinho',
            textInf: 'Mais rápido que a sombra! ih raaaahhh!',
            hrefButton: ''
        },
        donkeyComponent: {
            imgSrc: 'https://ualmedia.pt/wp-content/uploads//2018/06/800_DSC_0112.jpg',
            cardTitle: 'Burrinho',
            textInf: 'Mais esperto que eu não há!',
            hrefButton: ''
        },
        nextAnimalComponent: {
            imgSrc: '',
            cardTitle: 'nextAnimal Name',
            textInf: '',
            hrefButton: ''
        },
    }



     return(
        <div className= 'Body'>
            <FarmAnimalCard //Porquinho
                imgSrc= {infToComponents.pigComponent.imgSrc} 
                cardTitle = {infToComponents.pigComponent.cardTitle}
                textInf = {infToComponents.pigComponent.textInf}
                hrefButton = {infToComponents.pigComponent.hrefButton}
                />
            <FarmAnimalCard //Ovelhinha
                imgSrc= {infToComponents.sheepComponent.imgSrc} 
                cardTitle = {infToComponents.sheepComponent.cardTitle}
                textInf = {infToComponents.sheepComponent.textInf}
                hrefButton = {infToComponents.sheepComponent.hrefButton}
                />
            <FarmAnimalCard //Cabrinha
                imgSrc= {infToComponents.goatComponent.imgSrc} 
                cardTitle = {infToComponents.goatComponent.cardTitle}
                textInf = {infToComponents.goatComponent.textInf}
                hrefButton = {infToComponents.goatComponent.hrefButton}
                />
            <FarmAnimalCard //Cavalinho
                imgSrc= {infToComponents.horseComponent.imgSrc} 
                cardTitle = {infToComponents.horseComponent.cardTitle}
                textInf = {infToComponents.horseComponent.textInf}
                hrefButton = {infToComponents.horseComponent.hrefButton}
                />
            <FarmAnimalCard //Burrinho
                imgSrc= {infToComponents.donkeyComponent.imgSrc} 
                cardTitle = {infToComponents.donkeyComponent.cardTitle}
                textInf = {infToComponents.donkeyComponent.textInf}
                hrefButton = {infToComponents.donkeyComponent.hrefButton}
                />


        </div>

     );
 }
}
